(self.webpackChunkuntil=self.webpackChunkuntil||[]).push([[807],{300:(l,e,i)=>{"use strict";i.r(e),i.d(e,{data:()=>t});const t={key:"v-fffb8e28",path:"/guide/",title:"사이트 구성",lang:"ko-KR",frontmatter:{},excerpt:"",headers:[{level:2,title:"테크와 논테크",slug:"테크와-논테크",children:[]},{level:2,title:"프로젝트",slug:"프로젝트",children:[]},{level:2,title:"삶",slug:"삶",children:[]}],filePathRelative:"guide/README.md",git:{updatedTime:1618151341e3}}},475:(l,e,i)=>{"use strict";i.r(e),i.d(e,{default:()=>r});const t=(0,i(6252).uE)('<h1 id="사이트-구성"><a class="header-anchor" href="#사이트-구성">#</a> 사이트 구성</h1><div class="custom-container warning"><p class="custom-container-title">무언가 알려주실 게 있거나 할 말이 있나요?</p><p>audgkwns44@gmail.com으로 연락 부탁해요.</p></div><p>이 블로그, &#39;<strong>UNTIL</strong>&#39;에 저는 공부한 것, 공부한 걸 써먹는 것, 하고싶어서 하는 것들을 정리할거에요. 제가 뭘 배웠는지 알고싶은 분들, 제가 배운 내용을 보고 같이 공부하고 싶으신 분들, 그냐 위키보듯이 사이트 구경하는 게 재밌는 분들, 모두 환영합니다!</p><p>그나저나 &#39;<strong>UNTIL</strong>&#39;은 블로그 홈에서 볼 수 있듯이 <strong>Until is Not Today I Learned</strong> 라는 뜻이에요.<br> 이게 진짜 중요해요. 이 블로그가 유사 TIL 프로젝트라는 뜻이거든요.</p><blockquote><p>TIL 프로젝트는 매일매일 꾸준히 공부하고, 공부한 걸 올리는 유-명한 개인 프로젝트에요.</p></blockquote><p>뭘 말하고 싶냐구요? 유사 TIL이지만 아무튼 공부한 거 올릴거라구요.</p><h2 id="테크와-논테크"><a class="header-anchor" href="#테크와-논테크">#</a> 테크와 논테크</h2><p><strong>UNTIL</strong> 블로그에서 가장 핵심이 되는 카테고리에요. &#39;공부한 것&#39;, &#39;공부한 걸 써 먹는 것&#39;, &#39;하고싶어서 하는 것&#39;에서 &#39;공부한 것&#39;을 담당하고 있죠.</p><ul><li>테크에는 당연히 조금이라도 테크와 관련이 있는 걸 모아놨어요. <ul><li><em>프로그래밍 언어</em> 카테고리에는 C, Python, JS, HTML과 CSS가 현재 해당되죠.</li><li><em>프로그래밍 이론</em> 카테고리는 아직 준비중이에요.</li><li><em>메이킹</em> 카테고리에는 <code>메이킹</code>, <code>테크</code>와 모두 관련된 아두이노, 프로세싱이 해당돼요.</li><li>그리고 나머지는 <em>기타</em> 카테고리에 넣었어요. 현재로서는... <ul><li>이 블로그를 구성한 프레임워크, 뷰프레스와</li><li>구글 관련 내용이 있네요.</li></ul></li></ul></li><li>논테크에는 분명히 공부한 건 맞는데, 차마 테크와 관련되었다고 할 수 없는 것들이 있어요. <ul><li>현재는 <em>샤이학문-수능수학</em> 뿐이에요.</li></ul></li></ul><h2 id="프로젝트"><a class="header-anchor" href="#프로젝트">#</a> 프로젝트</h2><p>어떤 프로젝트가 기획되면 해당 프로젝트 페이지가 생성되고, 프로젝트의 진행에 따라 얼마나 구현됐는지, 어디서 오류가 발생했는지, 어떻게 고쳤는지, 무엇이 변경되었는지, 결과물은 어떤지 등이 모두 기록돼요. 같이 따라해보셔도 되고, &#39;앗 그거 그렇게 하는 거 아닌데&#39; 싶으시면 블로그 홈의 연락처로 연락 주시면 돼요 😄</p><h2 id="삶"><a class="header-anchor" href="#삶">#</a> 삶</h2><p>하고싶은 걸 모아놓은 곳이죠. 와! 파라다이스!<br> 이 카테고리가 하고싶은 걸 모아놓다보니, 메모장의 성격이 강해요. 누구 보라고 만든 자료라기보다, 내가 보려고 만든 자료라는거죠 😃</p><ul><li><strong>독서와 서평</strong><ul><li>말 그대로 독서와 서평이에요. 어디가서 독서가 취미라고는 못 하겠지만, 그래도 가끔은 읽어요!</li></ul></li><li><strong>취미</strong><ul><li>음향 엔지니어링과 영상편집이 있어요. 여기저기 써먹을 곳 많은 좋은 특기죠.</li><li>&#39;미디어&#39;라고 해석하셔도 좋아요. 제가 기초가 없어서, 아주 기초적인 것들 부터 정리할거에요.</li></ul></li></ul>',14),r={render:function(l,e){return t}}}}]);